Поэтому врачи рекомендуют принимать магний при обнаружении хотя бы одного из симптомов дефицита: 
дрожание рук и нервный тик; 
раздражительность и нарушения сна; 
судороги икроножных мышц и свода стопы; 
нарушение концентрации внимания; 
рассеянность; 
аритмия; 
головные боли, мигрень; 
выраженные симптомы ПМС – раздражительность, сонливость, повышение аппетита;
панические атаки; 
снижение работоспособности и быстрая утомляемость; 
